        console.log(id)
        console.log(header)

        axios.get("http://localhost:9087/customer/"+id ,{
          headers: {'Authorization' : 'Bearer '+header}
        })
            .then(response => {
                console.log(response.data)
            })
            .catch(err => {
                console.log('error')
                console.log(err)
            })
    }

    useEffect(()=>{
        getData()
    },[])
    return(
        <>

        </>
    )
}
